import React from 'react';
import Login from './Login';
import Register from './Register';
import {
  BrowserRouter as Router,
  Switch,
  Link,
  Route
} from "react-router-dom";

export default function ProjectManager() {
  return (
    <div className="container">
      <Router>
        <Switch>
          <Route path="/login">
            <Login />
          </Route>
          <Route path="/register">
            <Register />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}
